// 기본 api url 주소
//const URL_API = "http://localhost:8080/api/v1";
//const URL_API = "http://localhost:8080/api/v1";

// hello api url 주소
//const URL_HELLO = 'http://localhost:8080/api/v1/hello''/api/v1/hello';

// surveyDTO api url 주소
const URL_SURVEYDTO = `http://localhost:8080/api/v1/surveydto`;

function getSurveydto() {
    return fetch(URL_SURVEYDTO)
        .then(response => {
            return response.json();
        })
        .then(surveydto => {
            return surveydto;
        })
        .catch(error => console.log(error));
}

export {
    getSurveydto
}
